from typing import List


@lru_cache(maxsize=None)
def prime_factors(n: int) -> List[int]:
    if n == 1:
        return []
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return [i] + prime_factors(n // i)
    return [n]


@lru_cache(maxsize=None)
def prime_factors_divisors(n: int) -> List[List[int]]:
    if n == 1:
        return [[]]
    divisors = []
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            for d in prime_factors_divisors(n // i):
                divisors.append([i] + d)
    return divisors + [[]]


@lru_cache(maxsize=None)
def prime_factors_divisors_count(n: int) -> int:
    if n == 1:
        return 1
    count = 0
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            count += prime_factors_divisors_count(n // i)
    return count + 1


